import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "../App.css";

const Navbar = () => {
  const navigate = useNavigate();
  const [isOpen, setIsOpen] = useState(false);

  const handleLogout = () => {
    navigate("/login");
  };

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  const closeMenu = () => {
    setIsOpen(false);
  };

  return (
    <>
      {/* Header Bar */}
      <header className="flex items-center justify-between px-6 py-4 bg-gray-900 text-white shadow-md">
        <div className="flex items-center space-x-4">
          {/* Hamburger Icon */}
          <button
            className="text-2xl md:hidden focus:outline-none"
            onClick={toggleMenu}
          >
            ☰
          </button>
          <div className="text-xl font-bold">Admin Panel</div>
        </div>

        {/* Desktop Navigation */}
        <nav className="hidden md:flex space-x-6 items-center">
          <Link to="/dashboard" className="hover:text-yellow-400">
            Dashboard
          </Link>
          <Link to="/pending-partners" className="hover:text-yellow-400">
            Pending Partners
          </Link>
          <Link to="/approved-partners" className="hover:text-yellow-400">
            Approved Partners
          </Link>
          <Link to="/slots" className="hover:text-yellow-400">
            Slot Manager
          </Link>
          <Link to="/rate-card" className="hover:text-yellow-400">
            Rate Card
          </Link>
          <Link to="/partner-earnings" className="hover:text-yellow-400">
            Partner Earnings
          </Link>
          <button
            onClick={handleLogout}
            className="bg-red-600 hover:bg-red-700 px-3 py-1 rounded text-sm"
          >
            Logout
          </button>
        </nav>
      </header>

      {/* Sidebar (Mobile Menu) */}
      <div
        className={`fixed top-0 left-0 h-full w-64 bg-gray-800 text-white shadow-lg transform ${
          isOpen ? "translate-x-0" : "-translate-x-full"
        } transition-transform duration-300 ease-in-out z-50`}
      >
        <div className="flex justify-between items-center p-4 border-b border-gray-700">
          <h2 className="text-lg font-bold">Menu</h2>
          <button onClick={toggleMenu} className="text-2xl">
            ✕
          </button>
        </div>
        <nav className="flex flex-col space-y-4 p-4">
          <Link onClick={closeMenu} to="/dashboard">
            Dashboard
          </Link>
          <Link onClick={closeMenu} to="/pending-partners">
            Pending Partners
          </Link>
          <Link onClick={closeMenu} to="/approved-partners">
            Approved Partners
          </Link>
          <Link onClick={closeMenu} to="/slots">
            Slot Manager
          </Link>
          <Link onClick={closeMenu} to="/rate-card">
            Rate Card
          </Link>
          <Link onClick={closeMenu} to="/partner-earnings">
            Partner Earnings
          </Link>
          <button
            onClick={() => {
              closeMenu();
              handleLogout();
            }}
            className="bg-red-600 hover:bg-red-700 px-3 py-2 rounded"
          >
            Logout
          </button>
        </nav>
      </div>

      {/* Background Overlay when Sidebar Open */}
      {isOpen && (
        <div
          className="fixed inset-0 bg-black opacity-40 z-40"
          onClick={closeMenu}
        ></div>
      )}
    </>
  );
};

export default Navbar;
